import React, {useState} from "react";
import Main from "../Main"


const Button: React.FC = () => {

    const [page, setPage] = useState("subpage")

    if(page === "main"){
        return <Main />
    }

    return(
        <button onClick={() => setPage("main")}>メイン</button>
    )
}

export default Button;
